import React from 'react';
import './shop.scss';
import SHOP_DATA from './shop.data';

class Shop extends React.Component{
    constructor(props){
        super(props);

        this.state = {SHOP_DATA}
    }

    render(){
        <div>SHOP PAGE</div>
    }
}

export default Shop;
